import {
  GET_CONTACT,
  GET_ALL_CONTACT,
  REMOVE_CONTACT,
  SET_CONTACT
} from './type';
import axios from 'axios';
export const setContact = contact => dispatch => {
  try {
    const config = {
      headers: 'application/json'
    };
    dispatch({
      type: SET_CONTACT,
      payload: res.data
    });
  } catch (error) {}
};
